import React from 'react';
import styled from 'styled-components';
import {setFlex, fixed, colors, elevation} from '../../utilities';
import {SectionsContainer} from '../../elements/Container';
import Nin64 from '../../elements/svg/Nin64';



const HomeBase = ({className}) => {
    return (
        <div className={className}>
        <h1 className="home">NORYAN HOME</h1>
        </div>
    );
};

const Home = styled(HomeBase)`             

    .home{
        font-size: 8rem;
        color: ${colors.white_1};  
    }

`;

export default Home;
